import * as React from 'react'
import { NextUIProvider } from '@nextui-org/react';
import MyNavbar from './Components/MyNavbar';
import MyFooter from './Components/MyFooter';
import Home from './Components/Home';
import './app.css';

function App() {
  return (
    <NextUIProvider>
      <MyNavbar />
      <Home />
      <MyFooter />
    </NextUIProvider>

  );
}
export default App;
